import React from "react";
import Ul_li from "./Ul_Li";
function List() {
  return (
    <ul className="list-group">
   <Ul_li/>
      <li className="bg-dark text-white list-group-item">
        <input type="checkbox" id="feacbook" ></input>
        <label for="feacbook">feacbook</label>
      </li>
      <li className=" bg-dark  text-white list-group-item">
      <input type="checkbox" id="youtoub" ></input>
        <label for="youtoub">youtoub</label>
      </li>
      <li className=" bg-dark text-white  list-group-item">
      <input type="checkbox" id="instegram" ></input>
        <label for="instegram">instegram</label>
      </li>
    
    </ul>
  );
}
export default List;
